import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';

function App() {
    return (
        <Router>
            <div>
                <Link to="/">Home</Link>
            </div>
        </Router>
    );
}

export default App;
